                WriteLiteral(@"ss=""tab-pane fade show active"" id=""pills-home"" role=""tabpanel"" aria-labelledby=""pills-home-tab"">
                                    <h3 class=""tab-title"">Ürün Açıklaması</h3>
                                    <p>
                                        Papa II. Julius’un bilhassa çağırdığı Michelangelo, St. Pietro Bazilikası duvar ve tavanlarını sanatıyla donattı. Bu iş 4 senede tamamlayan Michelangelo, İncil’de geçenleri kronolojik olarak resmetti. Bu eserlerinden ön mühimi, “Adem’in Yaratılışı“dır. 1512’de tamamlanan bu fresk, o meşhur hikayeyi Rönesans’ın usta ismi Michelangelo’nun dehasından gösteriyor.
                                    </p>
                                    <p>
                                        İncil’e göre Tanrı, Adem’i kendi suretinden yarattı. Onun kaslı, kuvvetli bedenine can üfleyen Tanrı, daha sonra yanına Havva’yı gönderdi. Ancak Havva’dan bahsetmeyeceğim. Tanrı’nın bir parçası olan Adem, rahme düşmeyen ilk çekirdek; yani bir kadın tarafından dünyaya getirilmeye");
                WriteLiteral(@"n ilk ve tek insandır. Michelangelo‘nun tasviri de bunu bize Adem’i çamurdan bir tepeye yerleştirerek gösteriyor.
                                    </p>
                                    <p>
                                        Solda, bir çamur yükseltisinde sağ kolundan destek alarak duran Adem, sol elini Tanrı’nın ona doğru uzanan eline uzatıyor. Bu bir el ele veriş, tokalaşma değil, bunun için uğraşılmıyor. Burada, en kaba tabirle bir boşluk görüyoruz. Her milimi ölçülüp üzerine sayısız teori üretilen bu boşluk, 16. Yüzyıl’dan itibaren aklınıza getireceğiniz her türlü sanatın ‘zaman’a, ‘zamanlama’ya ve ‘zamansızlık’ı olmuştur. (En azından İtalya’da).
                                    </p>
                                    <p>
                                        Sağ tarafta sakallı ve kaslı bir Tanrı görüyorsunuz. Bu, insanlara verilen ilk Tanrı görüntüsüdür. Yukarıdaki sözlerime ek olarak Michelangelo, 16. Yüzyıl’da sanattan başka inanç sisteminde de bir değişim yarattı. Yaptığı Tanrı ");
                WriteLiteral(@"figürü, büyük bir cesaret işiydi. Mekan Vatikan olduğu için Michelangelo’ya övgümün yalnız sanatı değil, cesur sanatından ileri geldiğini eklemek isterim. Tanrı’nın taşıyıcıları ise baş melekleri. Adem’in muhtaç bakışlarına karşın çok yorgun görünen Tanrı’nın şefkatli gözleri. Pek çok sanat tarihçisi, bu yüzün Michelangelo’nun kendisi olduğunu söylüyor. Bunun ucu açıktır. Ek olarak, Tanrı’nın duruşunu resmederken ustamız, Augustus‘un (nam*ı diğer ‘Jül Sezar’) zamanında paraya bastırdığı Oğlak üstündeki pozundan etkilenmiş.
                                    </p>
                                    <p>
                                        Sağdaki Tanrı figürünün sol koluyla kavradığı dişiye bakınız. Bu kadının zarif yüzünde bir telaş görünüyor. Araştırmacılar, bu dişinin Adem’e eş olacak Havva olduğuna inanıyorlar. Henüz sağda, Tanrı’nın cennetinde yer alan Havva, sol tarafa, yani yeryüzündeki cennete telaşla bakıyor.
                                    </p>
                                    <p>
  ");
                WriteLiteral(@"                                      İncil’deki kronolojik sıralamaya göre 4. hikaye olan “Adem’in Yaratılışı“, insanoğlunun başlangıç noktası; Milat olarak kabul edilir. İncil’e göre Tanrı, Adem’i kendi suretinden yarattı. Ustamız bu freskinde bunun tam aksini yapmış. Yani, Michelangelo, Tanrı’yı Adem’in suretinden yarattı. Bunun yanı sıra yıllarca insan anatomisi üzerinde çalışan Michelangelo‘nun dehasına hayranlık duyacağınız bir başka nokta da yine Tanrı’nın tarafında yer alıyor. Tanrı’yla meleklerinin alanına uzaktan bir bakın, insan beyninin biçimini ayrıntılarıyla görüyor musunuz?
                                    </p>

